import Box from "@material-ui/core/Box";
import React from "react";
import JSONPretty from "react-json-prettify";
import { github } from "react-json-prettify/themes";

import { IEmployee } from "../helpers/models";

interface IProps {
    deletedEmployees: IEmployee[];
    editedEmployees: IEmployee[];
}

const UpdatedEmployees: React.FC<IProps> = ({ deletedEmployees, editedEmployees }) => {
    return (
        <>
            <Box>
                Updated: <JSONPretty theme={github} padding={4} json={JSON.stringify(editedEmployees)} />
            </Box>
            <Box marginTop={2}>
                Deleted: <JSONPretty json={JSON.stringify(deletedEmployees)} />
            </Box>
        </>
    );
};

export default UpdatedEmployees;
